sympy.sympy.logic.boolalg.__eq__:
def __eq__(self, other):
    if other is True:
        return False
    if other is False:
        return True
    return super().__eq__(other)

sympy.sympy.utilities.decorator.accessor:
@wraps(propfunc)
def accessor(self):
    val = getattr(self, attrname, sentinel)
    if val is sentinel:
        val = propfunc(self)
        setattr(self, attrname, val)
    return val
